import { useSelector } from 'react-redux'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import CardTodo from '../CardTodo'

const ListTodo = () => {

  const todos = useSelector(
    (state) => {
      return state.task
    }
  )
  console.log(todos)
  return (
    <Row>
      <Col>
        {
          todos && todos.map(
            (items, index) => (
              <CardTodo key={index} title={items.title} date={items.date} description={items.description} state={items.state}/>
            ) 
          ) 
        }        
      </Col>
    </Row>
  )  
}

export default ListTodo
